import { Button } from "@mui/material";
import React from "react";

const ButtonOnUp = () => {
    const onUp = () => {
        window.scrollTo(0, 0)
      }
  return (
    <Button variant="contained">
      <button  onClick={() => onUp()}>UP</button>
    </Button>
  );
};

export default ButtonOnUp;
